export const generateTimeSlots = (duration, bookedSlots = []) => {
    const startTime = 6;
    const endTime = 21;
    const timeSlots = [];
  
    let currentHour = startTime;
    let currentMinute = 0;
  
    console.log("bookedSlots", bookedSlots);

    for (const bookedSlot of bookedSlots) {
      const [bookedEndHour, bookedEndMinute] = bookedSlot.endTime.split(':').map(Number);
  
      if (bookedEndHour > currentHour || (bookedEndHour === currentHour && bookedEndMinute > currentMinute)) {
        currentHour = bookedEndHour;
        currentMinute = bookedEndMinute;
      }
    }
  
    while (currentHour < endTime || (currentHour === endTime && currentMinute === 0)) {
      const time = `${String(currentHour).padStart(2, '0')}:${String(currentMinute).padStart(2, '0')}`;
  
      const nextMinute = currentMinute + duration;
      let nextHour = currentHour;
  
      if (nextMinute >= 60) {
        nextHour += 1;
        currentMinute = nextMinute % 60;
      } else {
        currentMinute = nextMinute;
      }
  
      const endTime = `${String(nextHour).padStart(2, '0')}:${String(currentMinute).padStart(2, '0')}`;
      const label = `${time} - ${endTime}`;
  
      timeSlots.push({ label, value: { startTime: time, endTime } });
  
      currentHour = nextHour;
    }
  
    return timeSlots;
  };
